// ---------- ELEMENTOS ----------
const productContainer = document.getElementById("productContainer");
const cartBtn = document.getElementById("cartBtn");
const cartModal = document.getElementById("cartModal");
const modalBackdrop = document.getElementById("modalBackdrop");
const closeCartBtn = document.getElementById("closeCartBtn");
const cartItemsEl = document.getElementById("cartItems");
const cartTotalEl = document.getElementById("cartTotal");
const cartCountEl = document.getElementById("cartCount");
const clearCartBtn = document.getElementById("clearCartBtn");
const checkoutBtn = document.getElementById("checkoutBtn");
const categoryButtons = document.querySelectorAll(".catBtn");
const searchInput = document.getElementById("searchInput");

let cart = JSON.parse(localStorage.getItem("miCarrito")) || [];
let currentCategory = "all";
let searchTerm = "";

// ---------- RENDERIZAR PRODUCTOS ----------
function renderProducts(){
  productContainer.innerHTML = "";
  const visible = products
    .filter(p => (currentCategory === "all" || p.category === currentCategory))
    .filter(p => p.name.toLowerCase().includes(searchTerm.toLowerCase()));

  if(visible.length === 0){
    productContainer.innerHTML = `<p style="grid-column:1/-1;color:#6b7280;margin-top:30px">No se encontraron productos.</p>`;
    return;
  }

  visible.forEach(p => {
    const card = document.createElement("article");
    card.className = "card";
    card.innerHTML = `
      <div class="img"><img src="${p.img}" alt="${p.name}"></div>
      <h3>${p.name}</h3>
      <p class="price">$${p.price}</p>
      <div class="meta">${p.category}</div>
      <div class="actions"><button class="btn primary" data-id="${p.id}">Agregar</button></div>
    `;
    productContainer.appendChild(card);
  });
}
renderProducts();

// Delegaci√≥n de eventos para botones "Agregar"
productContainer.addEventListener("click", (e) => {
  const btn = e.target.closest("button[data-id]");
  if(!btn) return;
  const id = Number(btn.dataset.id);
  addToCart(id);
});

// ---------- CARRITO ----------
function saveCart(){
  localStorage.setItem("miCarrito", JSON.stringify(cart));
}

function addToCart(id){
  const prod = products.find(p => p.id === id);
  if(!prod) return;
  const inCart = cart.find(i => i.id === id);
  if(inCart) inCart.quantity++;
  else cart.push({ ...prod, quantity: 1 });
  updateCartUI();
  saveCart();
  // feedback visual peque√±o
  cartBtn.animate([{ transform: "scale(1)" }, { transform: "scale(1.05)" }, { transform: "scale(1)" }], { duration: 200 });
}

function updateCartUI(){
  // render items
  cartItemsEl.innerHTML = "";
  if(cart.length === 0){
    cartItemsEl.innerHTML = `<p style="color:#6b7280">Tu carrito est√° vac√≠o.</p>`;
    cartTotalEl.textContent = "0";
    cartCountEl.textContent = "0";
    return;
  }

  let total = 0;
  cart.forEach(item => {
    total += item.price * item.quantity;

    const div = document.createElement("div");
    div.className = "cart-item";
    div.dataset.id = item.id;
    div.innerHTML = `
      <img src="${item.img}" alt="${item.name}">
      <div class="info">
        <h4>${item.name}</h4>
        <small>$${item.price} c/u</small>
        <div class="qty-controls">
          <button class="qty-decrease" aria-label="Disminuir">‚àí</button>
          <span class="qty">${item.quantity}</span>
          <button class="qty-increase" aria-label="Aumentar">+</button>
        </div>
      </div>
      <div style="text-align:right">
        <div style="font-weight:700">$${item.price * item.quantity}</div>
        <button class="btn secondary remove-item" style="margin-top:8px">Eliminar</button>
      </div>
    `;
    cartItemsEl.appendChild(div);
  });

  cartTotalEl.textContent = total;
  cartCountEl.textContent = cart.reduce((s,i) => s + i.quantity, 0);
}

// Delegaci√≥n dentro del carrito: aumentar, disminuir, eliminar
cartItemsEl.addEventListener("click", (e) => {
  const itemEl = e.target.closest(".cart-item");
  if(!itemEl) return;
  const id = Number(itemEl.dataset.id);

  if(e.target.closest(".qty-increase")){
    const it = cart.find(i => i.id === id); it.quantity++; updateCartUI(); saveCart();
  } else if(e.target.closest(".qty-decrease")){
    const it = cart.find(i => i.id === id);
    if(!it) return;
    it.quantity = Math.max(1, it.quantity - 1);
    updateCartUI(); saveCart();
  } else if(e.target.closest(".remove-item")){
    cart = cart.filter(i => i.id !== id);
    updateCartUI(); saveCart();
  }
});

// Clear cart
clearCartBtn.addEventListener("click", () => {
  if(!confirm("¬øVaciar el carrito?")) return;
  cart = [];
  updateCartUI(); saveCart();
});

// Checkout (simulaci√≥n)
checkoutBtn.addEventListener("click", () => {
  if(cart.length === 0){ alert("Tu carrito est√° vac√≠o."); return; }
  alert("Gracias por tu compra (simulada).");
  cart = []; updateCartUI(); saveCart(); closeCart();
});

// Inicializar UI del carrito desde localStorage
updateCartUI();

// ---------- FILTRADO Y BUSCADOR ----------
categoryButtons.forEach(btn => {
  btn.addEventListener("click", () => {
    categoryButtons.forEach(b => b.classList.remove("active"));
    btn.classList.add("active");
    currentCategory = btn.dataset.category;
    renderProducts();
  });
});
searchInput.addEventListener("input", (e) => {
  searchTerm = e.target.value.trim();
  renderProducts();
});

// ---------- ABRIR / CERRAR MODAL ----------
function openCart(){
  cartModal.classList.remove("hidden");
  cartBtn.setAttribute("aria-expanded", "true");
}
function closeCart(){
  cartModal.classList.add("hidden");
  cartBtn.setAttribute("aria-expanded", "false");
}

cartBtn.addEventListener("click", openCart);
closeCartBtn.addEventListener("click", closeCart);

// cerrar al clickear el backdrop
modalBackdrop.addEventListener("click", closeCart);

// cerrar con ESC
document.addEventListener("keydown", (e) => {
  if(e.key === "Escape" && !cartModal.classList.contains("hidden")) closeCart();
});

// Previene scroll del body cuando modal est√° abierto
const observer = new MutationObserver(() => {
  if(!cartModal.classList.contains("hidden")) document.body.style.overflow = "hidden";
  else document.body.style.overflow = "";
});
observer.observe(cartModal, { attributes: true, attributeFilter: ["class"] });

